import img3 from "../icon-03.resized.png";
import "../App.css";
import "../css/about.css";



class About extends React.Component {


    render() {
        return (
            <div className="about"> 
                <div className="about1">My Skill Set </div>

                <div className="section">
                        <img src={img1} alt="" />
                        <p>HTML, CSS & JAVASCRIPT, PHP, JAVA...</p>

                    <p>
                             I have a lot of experience of working in front end and back end
                                development.

                            I can build impressive UIs using these fundamental web development
                            languages.
                        </p>
                    </div>

                <div className="section">
                <img src={img2} alt="" />
                            <p>REACT JS</p>
                            <p>
                                My main specialization is building powerful data driven UIs and
                                web applications using the ReactJS framework.

                            I do this full time for a living. </p>
                    </div>

                <div className="section">
                <img src={img3} alt="" />
                            <p>REACT NATIVE</p>
                            <p>
                                My React skills also become extremely useful for building cross
                                platform mobile applications (specifically Android & iOS) using
                                React Native.{" "}
                            </p>
                    </div>

                <div className="section">
                <img src={img4} alt="" />
                            <p>PERFORMANCE & SCALING</p>
                            <p>
                                I can use my professional JavaScript experience to scale and
                                improve existing applications.

                                {" "}
                                I make use of best practices to solve complicated problems and fix
                                bugs.{" "}
                            </p>
                    </div>

                <div className="about1">Place to find me </div>
                <div>
               <p>hello</p>
                </div>

             </div>

    );
    }
}

export default About;
